globdecl.text:
color INT = int; 
color DATA = string; 
color INTxDATA = product INT * DATA;
color E = with e;
var n, k : INT;
var p,str : DATA;
val stop = "########";

color BOOL = bool;
var Ok : BOOL;

aux.text:
(* Remove Instances *) OGSet.StringRepOptions'PI( fn (CPN'page, CPN'place, CPN'inst) => CPN'place);
OGSet.StringRepOptions'TI( fn (CPN'page, CPN'trans, CPN'inst) => CPN'trans);
(* Remove Empty Places *) OGSet.StringRepOptions'Mark( fn (CPN'PI, CPN'mark) => if CPN'mark="empty" orelse CPN'mark="tempty" then "" else CPN'PI^": "^CPN'mark^"\n");
